      function Features() {
        return {
          accelerationX: [],
          accelerationY: [],
          accelerationZ: [],
          accelerationIncludingGravityX: [],
          accelerationIncludingGravityY: [],
          accelerationIncludingGravityZ: [],
          rotationAlpha: [],
          rotationBeta: [],
          rotationGamma: [],
        };
      }
      let features;

      let interval;

      features = new Features(); // start empty
      points = [];

      const UPLOAD_RATE = 20; // How many data points are uploaded per second?

      let write = function () {
        if (features.accelerationX.length > 0) {
          let v = features; //copy old buffer to var to avoid async effects on write
          features = new Features(); // reset buffer

          function milli_mean_int(values) {
            //use mean * 1000 (int for efficiency)
            let sum = values.reduce(function (a, b) {
              return a + b;
            });
            return Math.floor((sum * 1000) / values.length);
          }

          let point = {
            accelerationX: milli_mean_int(v.accelerationX),
            accelerationY: milli_mean_int(v.accelerationY),
            accelerationZ: milli_mean_int(v.accelerationZ),
            accelerationIncludingGravityX: milli_mean_int(
              v.accelerationIncludingGravityX
            ),
            accelerationIncludingGravityY: milli_mean_int(
              v.accelerationIncludingGravityY
            ),
            accelerationIncludingGravityZ: milli_mean_int(
              v.accelerationIncludingGravityZ
            ),
            rotationAlpha: milli_mean_int(v.rotationAlpha),
            rotationBeta: milli_mean_int(v.rotationBeta),
            rotationGamma: milli_mean_int(v.rotationGamma),
          };

          points.push(point);

          while (points.length > 20) {
            points.shift();
          }
        } else {
        }
      };

      function aggregateTimestamps() {
        const recentPoints = points.slice(0, 20);
        // console.log(recentPoints.length);

        let accelerationX = recentPoints.map(
          (recentPoint) => recentPoint.accelerationX
        );
        let accelerationY = recentPoints.map(
          (recentPoint) => recentPoint.accelerationY
        );
        let accelerationZ = recentPoints.map(
          (recentPoint) => recentPoint.accelerationZ
        );
        let accelerationIncludingGravityX = recentPoints.map(
          (recentPoint) => recentPoint.accelerationIncludingGravityX
        );
        let accelerationIncludingGravityY = recentPoints.map(
          (recentPoint) => recentPoint.accelerationIncludingGravityY
        );
        let accelerationIncludingGravityZ = recentPoints.map(
          (recentPoint) => recentPoint.accelerationIncludingGravityZ
        );

        let rotationAlpha = recentPoints.map(
          (recentPoint) => recentPoint.rotationAlpha
        );
        let rotationBeta = recentPoints.map(
          (recentPoint) => recentPoint.rotationBeta
        );
        let rotationGamma = recentPoints.map(
          (recentPoint) => recentPoint.rotationGamma
        );

        const min = (arr) => {
          let minimum = arr[0];
          for (let i = 1; i < arr.length; i++) {
            if (arr[i] < minimum) {
              minimum = arr[i];
            }
          }
          return minimum;
        };

        const max = (arr) => {
          let maximum = arr[0];
          for (let i = 1; i < arr.length; i++) {
            if (arr[i] > maximum) {
              maximum = arr[i];
            }
          }
          return maximum;
        };

        const median = (arr) => {
          const mid = Math.floor(arr.length / 2),
            nums = [...arr].sort((a, b) => a - b);
          return arr.length % 2 !== 0
            ? nums[mid]
            : (nums[mid - 1] + nums[mid]) / 2;
        };

        const mean = (arr) => {
          return (
            arr.reduce(function (a, b) {
              return Number(a) + Number(b);
            }) / arr.length
          );
        };

        const varianz = (arr) => {
          let getMean = function (arr) {
            return (
              arr.reduce(function (a, b) {
                return Number(a) + Number(b);
              }) / arr.length
            );
          };
          let m = getMean(arr);
          return (
            arr.reduce(function (sq, n) {
              return sq + Math.pow(n - m, 2);
            }, 0) / arr.length
          );
        };

        const aggregatedFeatures = [];
        // const features = [
        //     'alpha_min', 'alpha_max', 'alpha_median', 'alpha_std',
        //     'beta_min', 'beta_max', 'beta_median', 'beta_std',
        //     'gamma_min', 'gamma_max', 'gamma_median', 'gamma_std'
        // ];
        /**
        aggregatedFeatures.push(mean(accelerationX));
        aggregatedFeatures.push(varianz(accelerationX));
        aggregatedFeatures.push(min(accelerationX));
        aggregatedFeatures.push(max(accelerationX));
        aggregatedFeatures.push(median(accelerationX));

        aggregatedFeatures.push(mean(accelerationY));
        aggregatedFeatures.push(varianz(accelerationY));
        aggregatedFeatures.push(min(accelerationY));
        aggregatedFeatures.push(max(accelerationY));
        aggregatedFeatures.push(median(accelerationY));

        aggregatedFeatures.push(mean(accelerationZ));
        **/
        aggregatedFeatures.push(varianz(accelerationZ));
        /**
        aggregatedFeatures.push(min(accelerationZ));
        aggregatedFeatures.push(max(accelerationZ));
        aggregatedFeatures.push(median(accelerationZ));

        aggregatedFeatures.push(mean(accelerationIncludingGravityX));
        aggregatedFeatures.push(varianz(accelerationIncludingGravityX));
        aggregatedFeatures.push(min(accelerationIncludingGravityX));
        aggregatedFeatures.push(max(accelerationIncludingGravityX));
        aggregatedFeatures.push(median(accelerationIncludingGravityX));

        aggregatedFeatures.push(mean(accelerationIncludingGravityY));
        aggregatedFeatures.push(varianz(accelerationIncludingGravityY));
        aggregatedFeatures.push(min(accelerationIncludingGravityY));
        **/
        aggregatedFeatures.push(max(accelerationIncludingGravityY));
       // aggregatedFeatures.push(median(accelerationIncludingGravityY));

        aggregatedFeatures.push(mean(accelerationIncludingGravityZ));
        aggregatedFeatures.push(varianz(accelerationIncludingGravityZ));
        //aggregatedFeatures.push(min(accelerationIncludingGravityZ));
       // aggregatedFeatures.push(max(accelerationIncludingGravityZ));
        aggregatedFeatures.push(median(accelerationIncludingGravityZ));

        //aggregatedFeatures.push(mean(rotationAlpha));
        aggregatedFeatures.push(varianz(rotationAlpha));
        aggregatedFeatures.push(min(rotationAlpha));
        /**
        aggregatedFeatures.push(max(rotationAlpha));
        aggregatedFeatures.push(median(rotationAlpha));

        aggregatedFeatures.push(mean(rotationBeta));
        aggregatedFeatures.push(varianz(rotationBeta));
        aggregatedFeatures.push(min(rotationBeta));
        aggregatedFeatures.push(max(rotationBeta));
        aggregatedFeatures.push(median(rotationBeta));

        aggregatedFeatures.push(mean(rotationGamma));
        aggregatedFeatures.push(varianz(rotationGamma));
        aggregatedFeatures.push(min(rotationGamma));
        aggregatedFeatures.push(max(rotationGamma));
        aggregatedFeatures.push(median(rotationGamma));
        
        **/
        return aggregatedFeatures;
      }

      function predict(features) {
        const prediction = score(features);
        
        if(prediction[0] >= 0.50){
          document.getElementById("debug1").innerHTML = prediction[0];
          return "Walking"
        }
        if(prediction[1] >= 0.50){
          document.getElementById("debug1").innerHTML = prediction[1];
          return "Standing"
        }
        if(prediction[2] >= 0.50){
          document.getElementById("debug1").innerHTML = prediction[2];
          return "Sitting"
        }
      }

      function classify() {
        let aggregatedFeatures = aggregateTimestamps();
        let prediction = predict(aggregatedFeatures);
        document.getElementById("debug2").innerHTML = prediction;
        let action;

        switch (prediction) {
          case "Standing":
            action = '<span style="font-size: 40pt; ">Du stehst</span>';
            break;
          case "Walking":
            action = '<span style="font-size: 150pt; ">Du l√§ufst.</span>';
            break;
          case "Sitting":
            action = '<span style="font-size: 80pt; ">Du sitzt!</span>';
            break;
        }

        document.getElementById("debug2").innerHTML = action;
      }

      document.addEventListener("DOMContentLoaded", function () {
        const btn = document.getElementById("request");
        btn.addEventListener("click", permission);
      });

      if (location.protocol != "https:") {
        location.href =
          "https:" +
          window.location.href.substring(window.location.protocol.length);
      }
      function permission() {
        if (
          typeof DeviceMotionEvent !== "undefined" &&
          typeof DeviceMotionEvent.requestPermission === "function"
        ) {
          // (optional) Do something before API request prompt.
          DeviceMotionEvent.requestPermission()
            .then((response) => {
              // (optional) Do something after API prompt dismissed.
              if (response == "granted") {
                window.addEventListener("devicemotion", (e) => {
                  document.getElementById("debug").innerHTML = "Recording";
                  window.addEventListener(
                    "devicemotion",
                    function (motion) {
                      // Read and store all acceleration and rotation values.
                      if (!isNaN(parseFloat(motion.acceleration.x))) {
                        features.accelerationX.push(motion.acceleration.x);
                      }
                      if (!isNaN(parseFloat(motion.acceleration.y))) {
                        features.accelerationY.push(motion.acceleration.y);
                      }
                      if (!isNaN(parseFloat(motion.acceleration.z))) {
                        features.accelerationZ.push(motion.acceleration.z);
                      }
                      if (
                        !isNaN(
                          parseFloat(motion.accelerationIncludingGravity.x)
                        )
                      ) {
                        features.accelerationIncludingGravityX.push(
                          motion.acceleration.x
                        );
                      }
                      if (
                        !isNaN(
                          parseFloat(motion.accelerationIncludingGravity.y)
                        )
                      ) {
                        features.accelerationIncludingGravityY.push(
                          motion.accelerationIncludingGravity.y
                        );
                      }
                      if (
                        !isNaN(
                          parseFloat(motion.accelerationIncludingGravity.z)
                        )
                      ) {
                        features.accelerationIncludingGravityZ.push(
                          motion.accelerationIncludingGravity.z
                        );
                      }
                      if (!isNaN(parseFloat(motion.rotationRate.alpha))) {
                        features.rotationAlpha.push(motion.rotationRate.alpha);
                      }
                      if (!isNaN(parseFloat(motion.rotationRate.beta))) {
                        features.rotationBeta.push(motion.rotationRate.beta);
                      }
                      if (!isNaN(parseFloat(motion.rotationRate.gamma))) {
                        features.rotationGamma.push(motion.rotationRate.gamma);
                      }
                    },
                    false
                  );
                  interval = window.setInterval(function () {
                    write();
                    classify();
                  }, 1000 / UPLOAD_RATE);
                });
              }
            })
            .catch(console.error);
        } else {
          alert("DeviceMotionEvent is not defined");
        }
      }

    for (var i = 0; i < v1.length; i++) {
        result[i] = v1[i] + v2[i];
    }
    return result;
}
function mulVectorNumber(v1, num) {
    var result = new Array(v1.length);
    for (var i = 0; i < v1.length; i++) {
        result[i] = v1[i] * num;
    }
    return result;
}
